sq--src-components-homepage-slider-index.query:
query MyQuery {
  allStrapiGallery(filter: {featured: {eq: true}}) {
    nodes {
      id
      image {
        localFile {
          childImageSharp {
            gatsbyImageData(layout: CONSTRAINED, placeholder: BLURRED)
          }
        }
      }
      featured
      title
    }
  }
}

sq--src-components-seo-js.query:
query SEO {
  site {
    siteMetadata {
      defaultTitle: title
      titleTemplate
      defaultDescription: description
      siteUrl: url
      defaultImage: image
      twitterUsername
    }
  }
}
